import React from 'react';
import { Link } from 'react-router-dom';
import './css/Project.css';

export function Project({ media, link, title }) {
    const isVideo = media.endsWith('.mp4') || media.endsWith('.webm') || media.endsWith('.ogg');
    const isYouTube = media.includes('youtube.com') || media.includes('youtu.be');
  
    return (
      <div className="project-card">
        {isVideo ? (
          <video className="project-media" autoPlay loop muted>
            <source src={media} type="video/mp4" />
            <source src={media} type="video/webm" />
            <source src={media} type="video/ogg" />
            Your browser does not support the video tag.
          </video>
        ) : isYouTube ? (
          <iframe
            className="project-media"
            src={media}
            frameBorder="0"
            allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
          ></iframe>
        ) : (
          <div className="project-media" style={{ backgroundImage: `url(${media})` }}></div>
        )}
        <Link to={link} className="project-link">{title}</Link>
      </div>
    );
  }
  
  export default Project;
